on":"After a record-breaking 2024, Young Jonn is back to set the tone for an even bigger year with his latest single, Only Fans, his first release of 2025. The hitmaker, who dominated last year with his debut studio album Jiggy Forever, is wasting no time in keeping the momentum going.\n\nThe song embodies a carefree, larger-than-life energy as he likens his lifestyle to that of King Solomon, an idea that has his fans buzzing with anticipation.\n\nListen Now: YoungJonn.lnk.to/onlyfans\nFollow Young Jonn\nTwitter - https://bit.ly/3vK9iGV\nInstagram - https://bit.ly/3IeRruq\nSnapchat https://bit.ly/3JgXy2x\nTik Tok - https://www.tiktok.com/@youngjonn1\n\nListen here: \nSooner:  https://YoungJonn.lnk.to/sooner\nJiggy Forever : https://YoungJonn.lnk.to/jiggyforever\nLove Is Not Enough: https://youngjonn.lnk.to/LINEcc\n\nAbout Young Jonn\nJohn Saviours Udomboso, fondly known as Young Jonn \"The Wicked Producer\" is an award winning Afro-pop producer, singer/songwriter. Dubbed the Sound of the Streets, \"Young Jonn\" is the head huncho and musical genius behind some of the most memorable Artists that own the streets in the Street-Hop or Pop genre. With over 3 awards in some of the prestigious Awards in Nigeria, Young Jonn's sound, lyrics and beats have broken several legendary Artists on the Nigerian music scene since the mid-2000s.  Young Jonn's credits have established him as one of the most iconic producers in the last 10 years. Young Jonn signed an Artist Recording Agreement with Nigeria's foremost record label, Chocolate City with the aim to transition from being a producer to a Recording Artist. His first project Love Is Not Enough was released in the April 2022. In 2024, he released his long-awaited debut album, Jiggy Forever. The album boasts of anthems like Big Big Things, Aquafina, Sharpally, and Stronger.\n\nSubscribe to Young Jonn's channel for all the best and latest official music videos, albums, behind the scenes, live performances and more!","isCrawlable": Love Is Not Enough was released in the April 2022. In 2024, he released his long-awaited debut album, Jiggy Forever. The album boasts of anthems like Big Big Things, Aquafina, Sharpally, and Stronger.\n\nSubscribe to Young Jonn's channel for all the best and latest official music videos, albums, behind the scenes, live performances and more!"},"lengthSeconds":"150","ownerProfileUrl":"http://www.youtube.com/@YoungJonn","externalChannelId":"UCyz9HsyG9uh1vio0KZhcrnQ","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY","QA","RE","RO","RS","RW","SA","SB","SC","SD","SE","SG","SH","SI","SJ","SK","SL","SM","SN","SO","SR","SS","ST","SV","SX","SY","SZ","TC","TD","TF","TG","TH","TJ","TK","TL","TM","TN","TO","TR","TT","TV","TW","TZ","UA","UG","UM","US","UY","UZ","VA","VC","VE","VG","VI","VN","VU","WF","WS","YE","YT","ZA","ZM","ZW"],"isUnlisted":false,"hasYpcMetadata":false,"viewCount":"2045497","category":"Music","publishDate":"2025-02-28T09:00:07-08:00","ownerChannelName":"Young Jonn","liveBroadcastDetails":{"isLiveNow":false,"startTimestamp":"2025-02-28T17:00:07+00:00","endTimes
